import React, { Component } from 'react';


class BottomNav extends Component {

    handleClick(id){
        console.log(id);
     }

    render() { 

        var containerStyle = {
            margin: "0",
            padding: "0",
            position: "fixed",
            width: "100%",
            bottom: "0",
            border: "1px solid #e7e7e7",
            backgroundColor: "#9b4dca",
        }
    
        var ulStyle = {
            listStyleType: "none",

        }
    
        var liStyle = {
            textColor: "#fff"
        }

        return (
        <div className="container" style={containerStyle}>
            <ul style={ulStyle}>
                <li style={liStyle}><a href="#calculator" id="sample" onClick={() => this.handleClick("calculator")}>Calculator</a></li>
                <li style={liStyle}><a href="#data" id="sample" onClick={() => this.handleClick("data")}>Data</a></li>
            </ul> 
        </div>
            );
    }
}
 
export default BottomNav;
